import { memo, useEffect, useRef } from "react";
import { useGlobalContext } from "../utils/GlobalProvider";

import "swiper/css";
import { Swiper, SwiperSlide } from "swiper/react";

import { CiSquarePlus } from "react-icons/ci";

function PageCategories() {
	const swiperRef = useRef(null);
	const { user, update_user } = useGlobalContext();

	const style = {
		backgroundImage:
			"url(https://images.unsplash.com/photo-1501167786227-4cba60f6d58f?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1770&q=80)",
	};

	return (
		<div className="page categories">
			<section>
				<div className="hero" style={style}>
					<div className="hero-content">
						<h1>My categories</h1>
					</div>
					<div className="overlay"></div>
				</div>
			</section>
			<section>
				<Swiper ref={swiperRef} slidesPerView={4} loop>
					<SwiperSlide>
						<div className="swiper-card">
							<CiSquarePlus size={30} />
							<p>Add categorie</p>
						</div>
					</SwiperSlide>
				</Swiper>
			</section>
		</div>
	);
}

export default memo(PageCategories);
